[Form]
public class WHSWorkTable extends FormRun implements WHSIWorkTemplateFormFilter
{
    InventDimCtrl_Frm_WHS	 inventDimFormSetup;

    InventDimParm            inventDimParmActive;

    QueryBuildRange          qbrClosed;

    boolean                  calledFromForm;

    WHSWorkTableForm         whsWorkTableForm;

}

    public void init()
    {
        super();

        var qbdsTmpWorkId = whsTmpWorkId_q.dataSourceTable(tableNum(WHSTmpWorkId));
        qbdsTmpWorkId.enabled(false);

        whsWorkTableForm = new WHSWorkTableForm();

        Common argsRecord = element.args().record();

        if (argsRecord || element.args().lookupField())
        {
            this.adjustWhsWorkTableQuery(argsRecord);

            calledFromForm = true;
        }

        if (!calledFromForm)
        {
			qbrClosed.value(whsWorkTableForm.setShowClosedFilter(false));
        }
        else
        {
            closedFilter.enabled(false);
        }

        element.updateDesign(InventDimFormDesignUpdate::Init);
    }

/// <summary>
/// Adjusts the WhsWorkTable query based on the passed argument record.
/// </summary>
/// <param name = "_argsRecord">Argument record.</param>
private void adjustWhsWorkTableQuery(Common _argsRecord)
{
    WhsWorkTableFormQuery workTableFormQuery = WhsWorkTableFormQuery::newFromRecord(_argsRecord);

    if (workTableFormQuery)
    {
        workTableFormQuery.updateWorkTableFormQuery(whsWorkTable_ds.query());
    }
    else
    {
        this.setFilter(_argsRecord);
    }
}

