/// <summary>
/// Modify the form query to only display those work orders that have a line with the specified location.
/// </summary>
/// <param name = "_location">Warehouse location record to use as the filter.</param>
/// <returns>Empty string. Can be overridden to filter the list further based on WorkIds.</returns>
public str locationTableFilter(WMSLocation _location)
{
    var qbdsWorkTable = WHSWorkTable_q.dataSourceTable(tableNum(WHSWorkTable));
    SysQuery::findOrCreateRange(qbdsWorkTable, fieldNum(WHSWorkTable, InventLocationId)).value(queryValue(_location.InventLocationId));

    var qbdsWorkLineWithLocation = SysQuery::findOrCreateDataSource(WHSWorkTable_q, tableNum(WHSWorkLine), tableNum(WHSWorkTable));
    qbdsWorkLineWithLocation.relations(true);
    qbdsWorkLineWithLocation.joinMode(JoinMode::ExistsJoin);
    SysQuery::findOrCreateRange(qbdsWorkLineWithLocation, fieldNum(WHSWorkLine, wmsLocationId)).value(queryValue(_location.wmsLocationId));

    return '';
}

    /// <summary>
    /// Creates a list of work id's for the WHSWorkTable form based on the table the form is called from and inserts it into the temp table.
    /// </summary>
    /// <param name = "_common">The record being used to determine what filters to set.</param>
    /// <returns>The WHSTmpWorkId table buffer for the WHSWorkTable form based on the table the form is called from,
    /// or null if the calling table is empty or has not been moved to this solution.</returns>
    [Hookable]
    protected WHSTmpWorkId workIdList(Common _common)
    {
        WHSTmpWorkId     tmpWorkIds;
        RecordInsertList whsWorkIds;

		switch (_common.TableId)
		{
			case tableNum(WHSLoadTable):
				whsWorkIds = whsWorkTableForm.populateLoadWorkIdList(_common.(fieldNum(WHSLoadTable, LoadId)), tmpWorkIds);
				break;
			default:
				return null;
		}

		whsWorkIds.insertDatabase();

        return tmpWorkIds;
    }

/// <summary>
/// Gets the filter string for the WHSWorkTable form based on the table the form is called from.
/// </summary>
/// <param name = "_common">The record being used to determine what filters to set.</param>
/// <returns>The filter string for the WHSWorkTable form based on the table the form is called from.</returns>
[Hookable]
protected str workIdFilter(Common _common)
{
    str filter;

    switch (_common.TableId)
    {
        case tableNum(InventQualityOrderTable):
            filter = whsWorkTableForm.inventTransIdFilter(_common.(fieldNum(InventQualityOrderTable, InventRefTransId)));
            break;

        case tableNum(WHSLoadTable):
            filter = whsWorkTableForm.loadFilter(_common.(fieldNum(WHSLoadTable, LoadId)));
            break;

        case tableNum(SalesLine):
            filter = whsWorkTableForm.inventTransIdFilter(_common.(fieldNum(SalesLine, InventTransId)));
            break;

        case tableNum(PurchLine):
            filter = whsWorkTableForm.inventTransIdFilter(_common.(fieldNum(PurchLine, InventTransId)));
            break;

        case tableNum(WMSLocation):
            filter = this.locationTableFilter(_common);
            break;

        case tableNum(WHSShipmentTable):
            filter = whsWorkTableForm.shipmentTableFilter(_common.(fieldNum(WHSShipmentTable, ShipmentId)));
            break;

        case tableNum(WHSWorkTable):
            if (this.args().menuItemName() == menuitemDisplayStr(WHSReplenishmentWork))
            {
                filter = whsWorkTableForm.replenishmentWorkFilter(_common.(fieldNum(WHSWorkTable, WorkId)));
                whsWorkTable_q.dataSourceTable(tableNum(WHSWorkTable)).clearDynalinks();
            }
            else
            {
                filter = _common.(fieldNum(WHSWorkTable, WorkId));
            }
            break;

        case tableNum(WHSWorkLineView):
            filter = _common.getFieldValue(fieldStr(WHSWorkLineView, WorkId));
            break;

        case tableNum(InventTrans):
            filter = InventTransOrigin::find(_common.(fieldNum(InventTrans, InventTransOrigin))).ReferenceId;
            break;

        case tableNum(InventTransferLine):
            filter = whsWorkTableForm.inventTransIdFilter(_common.(fieldNum(InventTransferLine, InventTransId)));
            break;

        case tableNum(WHSCycleCountPlanOverview):
            whsWorkTable_ds.query().dataSourceTable(tableNum(WHSWorkTable)).addRange(fieldNum(WHSWorkTable, CycleCountPlanOverview)).value(SysQuery::value(_common.(fieldNum(WHSCycleCountPlanOverview, RecId))));
            break;

        case tableNum(ProdTable):
            filter = whsWorkTableForm.prodTableFilter(_common.(fieldNum(ProdTable, ProdId)));
            SysQuery::findOrCreateRange(whsWorkTable_ds.query().dataSourceTable(tableNum(WHSWorkTable)), fieldNum(WHSWorkTable, WorkTransType)).value(SysQuery::valueUnlimited());
            break;

        case tableNum(WHSWorkLineCycleCount):
            filter = whsWorkTableForm.workLineCycleCountFilter(_common.(fieldNum(WHSWorkLineCycleCount, AdjustmentWorkId)));
            break;

        case tableNum(WHSContainerTable):
            filter = whsWorkTableForm.containerFilter(_common);
            break;

        case tableNum(KanbanBoardTmpTransferJob):
            filter = whsWorkTableForm.kanbanIdFilter(_common.(fieldNum(KanbanBoardTmpTransferJob, KanbanId)));
            break;
    }

    if (!_common.RecId && element.args().lookupField())
    {
        filter = element.args().lookupValue();
    }

    return filter;
}

