/// <summary>
///    Sets the filter for the WHSWorkTable form based on the table the form is called from.
///    The flighted code performs a join with the temp table containing the collected work id's.
/// </summary>
/// <param name="_common">
///    The record being used to determine the workId filter or the work id's to insert into the temp table.
/// </param>
public void setFilter(Common _common)
{
    WHSTmpWorkId tmpWorkIds = this.workIdList(_common);

    if (tmpWorkIds.WorkId)
    {
        if (!this.overrideWorkId(_common))
        {
            if (tmpWorkIds.WorkId || this.clearWHSWorkTableDynaLinks(_common))
            {
                var qbdsTmpWorkId= whsTmpWorkId_q.dataSourceTable(tableNum(WHSTmpWorkId));
                qbdsTmpWorkId.enabled(true);

                whsTmpWorkId.linkPhysicalTableInstance(tmpWorkIds);
            }
            else
            {
                var qbdsWorkTable = whsWorkTable_q.dataSourceTable(tableNum(WHSWorkTable));
                qbdsWorkTable.addRange(fieldNum(WHSWorkTable, WorkId)).value(SysQuery::valueEmptyString());
            }
        }
    }
    else
    {
        if (!this.overrideWorkId(_common))
        {
            str filter = this.workIdFilter(_common);
            var qbdsWorkTable = whsWorkTable_q.dataSourceTable(tableNum(WHSWorkTable));

            if (filter || this.clearWHSWorkTableDynaLinks(_common))
            {
                qbdsWorkTable.addRange(fieldNum(WHSWorkTable, WorkId)).value(filter);
                qbdsWorkTable.clearDynalinks();
            }
            else
            {
                qbdsWorkTable.addRange(fieldNum(WHSWorkTable, WorkId)).value(SysQuery::valueEmptyString());
            }
        }
    }

    whsWorkTable_ds.executeQuery();
}

public void showClosed(boolean _showClosed)
{
    qbrClosed.value(whsWorkTableForm.setShowClosedFilter(_showClosed));
    whsWorkTable_ds.executeQuery();
}

public void updateDesign(InventDimFormDesignUpdate _mode)
{
    InventDimParm inventDimParmLocal;

    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetup)
            {
                inventDimFormSetup = InventDimCtrl_Frm_WHS::newFromForm(element);
                inventDimParmLocal.setAllProductDimensions();
                inventDimParmLocal.InventBatchIdFlag = NoYes::Yes;
                inventDimParmLocal.InventSerialIdFlag = NoYes::Yes;
                inventDimFormSetup.parmDimParmVisibleGrid(inventDimParmLocal);
            }

        case InventDimFormDesignUpdate::Active:
            inventDimFormSetup.formActiveSetup();
            inventDimFormSetup.formSetControls(true);
            break;

        default:
            throw error(strFmt("@SYS54195", funcName()));
    }
}

/// <summary>
/// Allow the query to execute and refilter the records if the user clicks refresh or presses F5
/// </summary>
/// <param name = "_taskId">
/// The task ID of the task that is happening
/// </param>
/// <returns>
/// Value of super(_taskId)
/// </returns>
public int task(int _taskId)
{
    #Task

    if (_taskId == #taskF5 || _taskId == #taskRefresh)
    {
        if (calledFromForm)
        {
            this.adjustWhsWorkTableQuery(element.args().record());
        }
    }

    int ret = super(_taskId);

    return ret;
}

