private boolean canEnableChangeWorkPoolOnWork()
{
    MultiSelectionHelper multiSelectionHelper = this.constructMultiSelectionHelperWithWorkTableDS();
    WHSWorkTable workTable = multiSelectionHelper.getFirst();

    while (workTable)
    {
        if (!workTable.canChangeWorkPool())
        {
            return false;
        }

        workTable = multiSelectionHelper.getNext();
    }

    return true;
}

private MultiSelectionHelper constructMultiSelectionHelperWithWorkTableDS()
{
    MultiSelectionHelper multiSelectionHelper = MultiSelectionHelper::construct();

    multiSelectionHelper.parmDatasource(WHSWorkTable_ds);

    return multiSelectionHelper;
}

