public int active()
{
    int ret;

    ret = super();

    WHSChangeWorkLockedUser.enabled(WhsWorkTableForm::allowChangeWorkLockedUser(element));
    loadButton.enabled(whsWorkTable.LoadId != '');
    shipmentButton.enabled(whsWorkTable.ShipmentId != '');
    sourceButton.enabled(whsWorkTable.OrderNum != '' || whsWorkTable.WorkTransType == WHSWorkTransType::CycleCountAccepted);
    waveButton.enabled(whsWorkTable.WaveId != '');
    btnOutboundShipConfirm.enabled(WHSShipConfirmationAction::newFromBuffer(WHSLoadTable::find(whsWorkTable.LoadId)).canEnableShipConfirm());
    whsReplenishmentWork.enabled(WHSReplenWorkLink::demandHasReplenishmentLink(whsWorkTable.WorkId));
    whsWorkLineCycleCount.enabled(whsWorkTable.WorkTransType == WHSWorkTransType::CycleCount);
    WHSChangeWorkPoolOnWork.enabled(element.canEnableChangeWorkPoolOnWork());

    if (whsWorkDeferredPutProcessingTask.visible())
    {
        whsWorkDeferredPutProcessingTask.enabled(whsWorkTable.hasDeferredPutProcessingTasks());
    }

    element.enableBlockUnblockButton();
    element.enableSplitWorkFeature();

    WHSWorkTable_ds.object(fieldNum(WHSWorkTable, ReplenishmentDependentWorkBlockingPolicy)).visible(WhsWorkCreateReplenishment::isReplenishmentAllowedForWorkTransType(WHSWorkTable.WorkTransType));
    WHSWorkTable_ds.object(fieldNum(WHSWorkTable, ReplenishmentDependentWorkBlockingPolicy)).allowEdit(WHSWorkTable.WorkStatus == WHSWorkStatus::Open);

    WHSWorkTable_isImmediateReplenishment.visible(whsWorkTable.WorkTransType == WHSWorkTransType::Replenishment);

    WHSWorkLine_ds.object(fieldNum(WHSWorkLine, AllocatedWMSLocationId)).visible(WHSWorkTable.WorkCreationFailedOnReservation);
    WHSWorkLine_ds.object(fieldNum(WHSWorkLine, WorkCreationFailedOnReservation)).visible(WHSWorkTable.WorkCreationFailedOnReservation);

    WHSWaveLabel.enabled(WHSWaveLabel::existWorkId(WHSWorkTable.WorkId));
    return ret;
}

