public void clicked()
{
    Args                 args = new Args();
    WHSWaveTable         waveTable;

    waveTable = WHSWaveTable::find(whsWorkTable.WaveId);
    args.record(waveTable);

    switch (waveTable.waveTemplate().WaveTemplateType)
    {
        case WHSWaveTemplateType::Production:
            new MenuFunction(menuitemdisplaystr(WHSProdWaveTable), MenuItemType::Display).run(args);
            break;

        case WHSWaveTemplateType::Shipping:
            new MenuFunction(menuitemdisplaystr(WHSWaveTable), MenuItemType::Display).run(args);
            break;
    }
}

